import React from "react";
import { BrowserRouter, Router, Routes, Route } from "react-router-dom";
import Home from "./Home";
const App = () => {
    return ( <
        Router >
        <
        Routes >
        <
        Route path = "/"
        element = { < Home / > }
        /> <
        Route path = "/about"
        element = { < About / > }
        /> <
        /Routes> <
        /Router>
    );
};

export default App;
